import React from 'react';
import Container from '../components/container';
import Text from '../components/text';

const Home = () => {
  return (
    <Container>
      <Text fontSize='mainTitle'>하루 그림</Text>
      <Text>당신의 그림습관</Text>
      <Text fontSize='massive'>"스케치북"</Text>
    </Container>
  );
};

export default Home;
